import { useState } from 'react';
import { Menu, Button, MenuItem } from '@material-ui/core';

export default function SimpleMenu() {
    const [anchorEl, setAnchorEl] = useState(null);
    const [time, setTime] = useState('Hi');

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleTimeClick = (event) => {
        console.log(event.target.textContent);
        setTime(event.target.textContent);
    }

    const handleClose = () => {
        setAnchorEl(null);
    };

    return (
        <div>
            <Button children={ time } aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}/>
            <Menu
                id="simple-menu"
                anchorEl={anchorEl}
                keepMounted
                open={Boolean(anchorEl)}
                onClose={handleClose}
                PaperProps={{ style: {maxHeight: 200}} }
            >
                <MenuItem children="12:00am" onClick={handleClose, handleTimeClick}/>
            </Menu>
            <input onChange={event => setTitle(event.target.value)} />
            <div>{ title }</div>
        </div>
    );
}
